cedf73be34d7e11c718439d396fbe608:
query ShowsQuery(
  $count: Int!
  $cursor: String
) {
  me {
    ...Shows_me_1G22uz
    __id
  }
}

fragment Shows_me_1G22uz on Me {
  followsAndSaves {
    shows(first: $count, after: $cursor) {
      edges {
        node {
          id
          is_followed
          _id
          name
          partner {
            __typename
            ... on Partner {
              name
            }
            ... on ExternalPartner {
              name
              __id
            }
            ... on Node {
              __id
            }
          }
          href
          status
          images(size: 1) {
            url
          }
          __id
          __typename
        }
        cursor
      }
      pageInfo {
        endCursor
        hasNextPage
      }
    }
  }
  __id
}
